A INTERRUPÇÃO DO CONTRATO Nº 22/2018, CASO OCORRA, CUJO SERVIÇO PRESTADO É ESSENCIAL, PODE COMPROMETER A LIMPEZA E HIGIENIZAÇÃO DO AMBIENTE DE TRABALHO E DAS INSTALAÇÕES FÍSICAS DA EPL, GERAR DANOS A SAÚDE DOS PROFISSIONAIS, COLABORADORES E DO PÚBLICO EM GERAL, IMPLICAR EM SÉRIOS TRANSTORNOS E PREJUÍZOS ÀS AÇÕES DESENVOLVIDAS PELA ESTATAL, AFETAR O FUNCIONAMENTO REGULAR DAS UNIDADES ORGANIZACIONAIS, BEM COMO OCASIONAR INEFICIÊNCIA NO SERVIÇO PÚBLICO A SER PRESTADO. EM FACE DISSO, FAZ-SE IMEDIATA PARA ATENDER ÀS DEMANDAS DESIGNADAS A ESTA EMPRESA.

O PRESENTE PEDIDO DE PRORROGAÇÃO DOS SERVIÇOS TERCEIRIZADOS, ESCOPO DO CONTRATO SOB ANÁLISE, SE JUSTIFICA EM VIRTUDE DAS SEGUINTES NECESSIDADES:

A) GARANTIR QUE AS INSTALAÇÕES PREDIAIS ESTEJAM SEMPRE LIMPAS E CONSERVADAS;

B) MANTER CONDIÇÕES ADEQUADAS DE SALUBRIDADE E HIGIENE;

C) ASSEGURAR A SAÚDE DOS PROFISSIONAIS;

D) CONSERVAR OS BENS MATERIAIS E PATRIMONIAIS;

E) AUMENTAR A PRODUTIVIDADE E QUALIDADE DOS SERVIÇOS PRESTADOS PELOS PROFISSIONAIS E COLABORADORES;

F) PRESERVAR O PATRIMÔNIO PÚBLICO;

G) DIMINUIR O ABSENTEÍSMO ETC.

A PROPÓSITO, COM RELAÇÃO A PRESTAÇÃO DOS SERVIÇOS OBSERVA-SE QUE A CONTRATADA:

A) PRODUZ OS RESULTADOS DE LIMPEZA E CONSERVAÇÃO COM A QUALIDADE EXIGIDA PELA EPL;

B) UTILIZA OS RECURSOS HUMANOS EXIGIDOS PARA A EXECUÇÃO DOS SERVIÇOS NA QUALIDADE E NA QUANTIDADE DEMANDADA;

C) PRESTA OS SERVIÇOS DENTRO DOS PARÂMETROS E ROTINAS ESTABELECIDOS, FORNECENDO TODOS OS MATERIAIS, EQUIPAMENTOS, FERRAMENTAS E UTENSÍLIOS NA QUANTIDADE REQUERIDA, QUALIDADE E TECNOLOGIA ADEQUADAS, COM A OBSERVÂNCIA AO ESTABELECIDO EM CONTRATO;

D) ATENDE A CONTENTO AS OBRIGAÇÕES ASSUMIDAS, DE ACORDO COM AS CLÁUSULAS CONTRATUAIS E OS TERMOS DE SUA PROPOSTA;

E) MOSTRA-SE EFICIENTE NAS AÇÕES DE MITIGAR A DISSEMINAÇÃO DO COVID-19 NA EPL, BEM COMO É PROATIVA E CÉLERE NO ATENDIMENTO DAS DEMANDAS DE SERVIÇOS/MATERIAIS DE LIMPEZA RELACIONADOS A PANDEMIA.

DESSA FORMA, NÃO SE VERIFICAM, ATÉ O MOMENTO, IRREGULARIDADES DA CONTRATADA NA EXECUÇÃO DOS SERVIÇOS QUE DESABONEM A CONDUTA DA EMPRESA COM ESTE ÓRGÃO. SEI Nº 4105465

